	add("impression", "{\"term\":\"impression\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027impression\u0027 from Latin \u0027impressio\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The indentation or depression made by the pressure of one object on or into another\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The overall effect of something, e.g., on a person\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d1|passage\u003dThe stories did not seem to me to touch life. […] They left me with the \u0027\u0027impression\u0027\u0027 of a well-delivered stereopticon lecture, with characters about as life-like as the shadows on the screen, and whisking on and off, at the mercy of the operator\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A vague of an event, a belief\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An impersonation, an imitation of the mannerisms of another individual\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"An outward appearance\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"An online advertising performance metric representing an instance where an ad. is shown once\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The first coat of colour, such as the priming in house-painting etc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A on paper from a wood block, metal plate, etc\", \"priority\":9}]}, \"synonyms\":{}}");

