	add("imprest", "{\"term\":\"imprest\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Prefix form of \u0027\u0027 perhaps after Italian \u0027imprestare\u0027 or perhaps from a misunderstand of the phrase \u0027in prest\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An advance of funds, especially to a government service or employee\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1977\u0027\u0027, \u0027The Honourable Schoolboy\u0027, Folio Society 2010, p. 240\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Calling on Lacon at the Cabinet Office to deliver the Circus\u0027s monthly \u0027\u0027imprest\u0027\u0027 account for his inspection, he had been astonished to see Sam emerging from his private office, joking easily with Lacon and Saul Enderby of the Foreign Office\", \"priority\":3}]}, \"synonyms\":{}}");

	add("imprimantur", "{\"term\":\"imprimantur\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin imprimantu. Latin|imprimantur \u0027let them be printed\u0027, third person plural present subjunctive passive form of imprimere \u0027to imprint\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1738\u0027\u0027: John Bancks, \u0027s:The Author’s Picture. A fourth Epistle to Mr. The Author’s Picture. A fourth Epistle to Mr. Pope.\u0027, 14\u0026lt;sup\u0026gt;th\u0026lt;/sup\u0026gt; verse, lines 7–1\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Then thus we sum up our affairs\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"That, notwithstanding former airs\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The most I seriously would hope\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Is, just to read the words, A Pope\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Writ, without sneer, or shew of banter\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Beneath your friendly \u0027\u0027Imprimantur\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1799–1833)\u0027\u0027: J. Souter et alii, \u0027The London Medical and Physical Journal\u0027, p38\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"…among other pleasing circumstances, let our constant correspondent the indefatigable Mr. Ring, derive an unmixed gratification from learning that his writings, together with those of the Society in which he incessantly labours, receive the \u0027\u0027\u0027imprimantur\u0027\u0027\u0027 of the Physician General at Madras\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1836\u0027\u0027: William Cowper \u0026amp; Robert Southey, \u0027The Works of William Cowper, Esq., Comprising His Poems, Correspondence and Translations. With a Life of the Author\u0027, p3\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"You are perfectly at liberty to deal with them as you please. \u0027Auctore tantum anonymo, \u0027\u0027imprimantur\u0027\u0027;\u0027 and when printed, send me a copy\u0026lt;sup\u0026gt;41\u0026lt;/sup\u0026gt\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"1891\u0027\u0027: Robert Williams Buchanan, \u0027The Coming Terror and Other Essays and Letters\u0027, p10\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"…any literature touching upon it is to be condignly abolished \u0027\u0027\u0027Imprimantur\u0027\u0027\u0027, the revised New Testament, the ‘Lamplighter’, and the tracts of Christian knowledge\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027: William Cowper, \u0027The Works of William Cowper: His Life, Letters and Poems\u0027, p14\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"…\u0027\u0027imprimantur\u0027\u0027; and when printed but for half an hour, yet, without boasting…\", \"priority\":15}]}, \"synonyms\":{}}");

