	add("imprisonment", "{\"term\":\"imprisonment\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027emprisonement\u0027 from Old french (842-ca. 1400) \u0027emprisonnement\u0027 See {{suffix|imprison|ment|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A confinement in a place, especially a prison or a jail, as punishment for a crime\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Spense\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"His sinews waxen weak and raw / Through long \u0027\u0027imprisonment\u0027\u0027 and hard constraint\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Blackston\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Every confinement of the person is an \u0027\u0027imprisonment\u0027\u0027, whether it be in a common prison, or in a private house, or even by forcibly detaining one in the public streets\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Oh, by what plots, by what forswearings, betrayings, oppressions, \u0027\u0027imprisonments\u0027\u0027, tortures, poisonings, and under what reasons of state and politic subtilty, have these forenamed kings pulled the vengeance of God upon themselves\", \"priority\":6}]}, \"synonyms\":{}}");

