	add("improvement", "{\"term\":\"improvement\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027emprouwement\u0027 See {{suffix|improve|ment|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of improving; advancement or growth; promotion in desirable qualities; progress toward what is better; melioration; as, the improvement of the mind, of land, roads, etc\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"I look upon your city as the best place of \u0027\u0027improvement\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Exercise is the chief source of \u0027\u0027improvement\u0027\u0027 in all our faculties\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL1097634W The Mirror and the passage\u003dNothing was too small to receive attention, if a supervising eye could suggest \u0027\u0027improvements\u0027\u0027 likely to conduce to the common welfare. Mr. Gordon Burnage, for instance, personally visited dust-bins and back premises, accompanied by a sort of village bailiff, going his round like a commanding officer doing billets\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/finance-and-economics/21579879-buy-out-firm-really-does-focus-operational-improvements-engineers Engineers of a different passage\u003dPrivate-equity nabobs bristle at being dubbed mere financiers.Much of their pleading is public-relations bluster. Clever financial ploys are what have made billionaires of the industry’s veterans. “Operational \u0027\u0027improvement\u0027\u0027” in a portfolio company has often meant little more than promising colossal bonuses to sitting chief executives if they meet ambitious growth targets. That model is still prevalent today\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The act of making profitable use or application of anything, or the state of being profitably employed; a turning to good account; practical application, as of a doctrine, principle, or theory, stated in a discourse\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A good \u0027\u0027improvement\u0027\u0027 of his reason\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"I shall make some \u0027\u0027improvement\u0027\u0027 of this doctrine\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The state of being improved; betterment; advance; also, that which is improved; as, the new edition is an improvement on the old\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The parts of Sinon, Camilla, and some few others, are \u0027\u0027improvements\u0027\u0027 on the Greek poet\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Increase; growth; progress; advance\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"There is a design of publishing the history of architecture, with its several \u0027\u0027improvements\u0027\u0027 and decays\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Those vices which more particularly receive \u0027\u0027improvement\u0027\u0027 by prosperity\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"plural):\u0027 Valuable additions or betterments, as buildings, clearings, drains, fences, etc., on premises\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"Patent Laws):\u0027 A useful addition to, or modification of, a machine, manufacture, or composition\", \"priority\":15}]}, \"synonyms\":{}}");

