	add("impudence", "{\"term\":\"impudence\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027impudence\u0027 from Latin \u0027impudentia\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of being impudent, not showing due respect\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Impudent language, conduct or behavior\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"title\u003dThe Mirror and the chapter\u003d2|url\u003dhttp://openlibrary.org/works/OL1097634W|passage\u003d\u0027That\u0027 the young Mr. Churchills liked—but they did not like him coming round of an evening and drinking weak whisky-and-water while he held forth on railway debentures and corporation loans. Mr. Barrett, however, by fawning and flattery, seemed to be able to make not only Mrs. Churchill but everyone else do what he desired. And if the arts of humbleness failed him, he overcame you by sheer \u0027\u0027impudence\", \"priority\":3}]}, \"synonyms\":{}}");

	add("impunity", "{\"term\":\"impunity\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027impunité\u0027 from Latin \u0027impunitas\u0027 from \u0027impunis\u0027 (without punishment)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Exemption from punishment\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Freedom from punishment or retribution; security from any reprisal or injurious consequences of an action, behaviour etc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1846\u0027\u0027, w:Edgar Allan Edgar Allen Poe, \u0027s:The Cask of The Cask of Amontillado\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"I must not only punish but punish with \u0027\u0027impunity\u0027\u0027. A wrong is undressed when retribution overtakes its redresser\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027, Nelson Mandela, \u0027Long Walk to Freedom\u0027, Abacus 2010, p. 495\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The remoteness of the prison made the authorities feel they could ignore us with \u0027\u0027impunity\", \"priority\":6}]}, \"synonyms\":{}}");

